# encoding: UTF-8
# frozen_string_literal: true

Bundler.require :default, :development

module TestHelper
  extend Memoist

  def keys
    { "wisoky.co"         => OpenSSL::PKey.read(Base64.urlsafe_decode64("")),
      "powlowski.info"    => OpenSSL::PKey.read(Base64.urlsafe_decode64("")),
      "mcglynn.org"       => OpenSSL::PKey.read(Base64.urlsafe_decode64("")),
      "okon.info"         => OpenSSL::PKey.read(Base64.urlsafe_decode64("")),
      "ebert.biz"         => OpenSSL::PKey.read(Base64.urlsafe_decode64("")),
      "olsonjacobi.name"  => OpenSSL::PKey.read(Base64.urlsafe_decode64("")),
      "okunevabednar.io"  => OpenSSL::PKey.read(Base64.urlsafe_decode64("")),
      "gerhold.co"        => OpenSSL::PKey.read(Base64.urlsafe_decode64("")),
      "hoegerrenner.info" => OpenSSL::PKey.read(Base64.urlsafe_decode64("")),
      "rice.com"          => OpenSSL::PKey.read(Base64.urlsafe_decode64("")) }.freeze
  end
  memoize :keys

  def algorithms
    { "wisoky.co"         => "HS256",
      "powlowski.info"    => "RS256",
      "mcglynn.org"       => "HS256",
      "okon.info"         => "RS256",
      "ebert.biz"         => "HS512",
      "olsonjacobi.name"  => "RS384",
      "okunevabednar.io"  => "RS512",
      "gerhold.co"        => "HS384",
      "hoegerrenner.info" => "RS384",
      "rice.com"          => "HS512" }.freeze
  end
  memoize :algorithms

  def public_keychain
    keys.each_with_object({}) do |(id, key), memo|
      # HMAC uses single secret for encoding & decoding.
      memo[id] = algorithms.fetch(id).start_with?("HS") ? key.to_pem : key.public_key.to_pem
    end.freeze
  end
  memoize :public_keychain

  def private_keychain
    keys.each_with_object({}) { |(id, key), memo| memo[id] = key.to_pem }.freeze
  end
  memoize :private_keychain
end

Test::Unit::TestCase.send :include, TestHelper
